import React from "react";
import { Badge } from "react-bootstrap";
import { Testimonials } from "../dataProduct/dataProduct";

const TestimonialBadge = () => {
  const Totalbadge = Testimonials.reduce((testi) => testi.badGe > 0).length;

  return <Badge variant="info" bg="secondary">{Totalbadge}</Badge>;
};

export default TestimonialBadge;
